import React, { memo } from 'react';

import { Link } from '@material-ui/core';

const Action = ({ subtitle, title, href, ...props }) => {
  return (
    <div {...props}>
      {subtitle}
      &nbsp;
      <Link href={href} onClick={e => e.preventDefault()}>
        {title}
      </Link>
    </div>
  );
};

export default memo(Action);
